import React, { useEffect, useState } from 'react';

const DataFetcher = () => {
  const [data, setData] = useState([]);
  const [filter, setFilter] = useState('');  // Example of setting a filter

  // Fetch data from backend
  const fetchData = async () => {
    try {
      const response = await fetch(`http://localhost:5000/api/data?filter=${filter}`);
      const result = await response.json();
      setData(result);
      console.log(result); // Log the result to ensure it's being fetched correctly
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  // Fetch data when the component mounts or filter changes
  useEffect(() => {
    fetchData();
  }, [filter]);  // Empty array [] means this runs once when component mounts

  return (
    <div>
      <h1>Fetched Data</h1>
      <input
        type="text"
        placeholder="Enter filter"
        value={filter}
        onChange={(e) => setFilter(e.target.value)}
      />
      <button onClick={fetchData}>Fetch Data</button>

      {/* Table to display the data */}
      {data.length > 0 ? (
        <table border="1">
          <thead>
            <tr>
              <th>Date</th>
              <th>Revenue</th>
              <th>Net Income</th>
              <th>Gross Profit</th>
              <th>EPS</th>
              <th>Operating Income</th>

            </tr>
          </thead>
          <tbody>
            {data.map((item, index) => (
              <tr key={index}>
                <td>{item.date}</td>
                <td>{item.revenue}</td>
                <td>{item.net_income}</td>
                <td>{item.gross_profit}</td>
                <td>{item.eps}</td>
                <td>{item.operating_income}</td>

              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No data found</p>
      )}
    </div>
  );
};

export default DataFetcher;
